import React from "react";

const skillText = [
  {
    title: "Python",
    desc: "빅데이터 분석, 시계열 데이터 분석",
  },
  {
    title: "llm",
    desc: "파인튜닝, 프롬프트 엔지니어링, RAG",
  },
  {
    title: "GitHub(2.5/5)",
    desc: " 프로젝트를 진행하며 지속적으로 사용한 기술로, 준수한 수준의 성취도를 가지고 있습니다.",
  },
];

const Skill = () => {
  return (
    <section id="skill">
      <div className="skill__in ner">
        <h2 className="skill__title">
          Skills <em>기술 스택</em>
        </h2>
        <div className="skill__desc">
          {skillText.map((skill, key) => (
            <div key={key}>
              <span>{key + 1}.</span>
              <h3>{skill.title}</h3>
              <p>{skill.desc}</p>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default Skill;
